import React from 'react';

function SearchBar() {
  return (
    <div className='text-center'>
      <div className="form">
        <div className="input-group w-25" style={{marginLeft:"1000px"}}>
          <input
            type="text"
            className="form-control "
            style={{
              background: "#000000",
              color: "white",
              fontWeight: "500",
             
            }}
            placeholder='Search'
            id='searchbar'
          />
          <span className="input-group-text" id="search-icon" style={{ background: "#000000" }}>
            <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="white" className="bi bi-search" viewBox="0 0 16 16">
              <path d="M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001c.03.04.062.078.098.115l3.85 3.85a1 1 0 0 0 1.415-1.414l-3.85-3.85a1.007 1.007 0 0 0-.115-.1zM12 6.5a5.5 5.5 0 1 1-11 0 5.5 5.5 0 0 1 11 0"/>
            </svg>
          </span>
        </div>
      </div>
    </div>
  );
}

export default SearchBar;
